import { Fragment } from "react";
import { Outlet } from "react-router-dom";
import './navigation.style.scss';

const Navigation = () => {
    return (
        <Fragment>
            <div  className="navigation">
                <h1>Imma Navigation Bar</h1>
            </div>
        </Fragment>
    );
}

export default Navigation;
